import React from "react";
import styled from "styled-components";

const Box = styled.div`
  width: 400px;
  min-width: 400px;
  height: 230px;
  background-color: #999;

  margin: 25px;
`;

const PosterDiv = styled.div``;
const ContentDiv = styled.div``;

const MovieBox = () => {
  return <Box></Box>;
};

export default MovieBox;
